Lego Friends Meyveli İçecek Plaj Standı 42625
6 yaş ve üzeri kız ve erkek çocuklar için LEGO® Friends Meyveli İçecek Plaj Standı (42625) yiyecek oyunu setiyle çocukları yaratıcı olmaya teşvik edin. Sette inşa edilebilen bir meyveli içecek standı ve inşa edilebilen plaj arabası, ayrıca LEGO Friends Nova ve Niko mini bebekleri bulunur. Çocuklar, malzemeleri birleştirip blenderda karıştırarak pek çok farklı meyveli içecek çeşidi oluşturabilir. Nova ve Niko, içecekleriyle salıncakta dinlenirken ve sonra plaj arabasıyla gezmeye çıkarken hikayeyi canlandırabilirler. Bu LEGO yapım seti, yaratıcı oyunları teşvik etmek için menü panosu, sörf tahtası, can yeleği, araç kamerası ve yön levhası içerir. Keşfedecek daha çok arkadaşlık hikayesinin olduğu LEGO Friends evreninde çocuklar için daha fazla yaratıcı oyun setini (setler ayrı satılır) keşfedin. Bu set, sezgisel bir yapım için LEGO Builder uygulamasıyla birlikte gelir. Burada çocuklar modelleri 3 boyutlu yakınlaştırabilir ve döndürebilir, setleri kaydedebilir ve ilerlemeyi takip edebilir.;

Çocuklar için yemek oyunu seti – 6 yaş ve üzeri kız ve erkek çocuklar, 2 mini bebek ve bir deniz kaplumbağası figürü içeren LEGO® Friends Meyveli İçecek Plaj Standı ile plajda meyveli içecek yapma eğlencesi yaşayabilir;
Meyveli içecek kombinasyonlarını karıştırın – Çocuklar malzemeleri seçip blendera koyarak lezzetli içecek kombinasyonları hazırlarken bu LEGO® setiyle yaratıcı oyunlar çok eğlenceli;
Plaj sahnesini oluşturun – İnşa edilebilen bir meyveli içecek standının yanı sıra bu sette bulunan inşa edilebilen plaj arabası, salıncak, soğutucu ve yön levhasıyla çocuklar kendi plaj hikayelerini geliştirmeyi çok sevecek;
2 mini bebek ve bir deniz kaplumbağası figürü – Bu sette bir deniz kaplumbağası figürü, bir Niko mini bebek ve gözüne kum kaçtığında tepkisini göstermek için ekstra bir yüze sahip bir Nova mini bebek figürü bulunur;
Hikaye anlatımı için çok sayıda aksesuar – Çilek, muz, yaban mersini, portakal, yoğurt ve fıstık ezmesi gibi meyveli içecek malzemeleri, ayrıca bardaklar, sörf tahtası, can yeleği ve araç kamerası bulunur;
Çocuklar için hediye fikri – Bu LEGO® yapım seti, oyuncakları ve arkadaşlık hikayelerini seven çocuklar için eğlenceli bir hediye fikridir;
Ölçüler – 213 parçalı setteki meyveli içecek standının yüksekliği 13 cm, genişliği 12 cm, derinliği 4 cm’dir;

Lego Disney Princess Rapunzel'in Kulesi ve Snuggly Duckling 43241LEGO® ǀ Disney Princess Rapunzel’in Kulesi ve The Snuggly Duckling (43241) oyuncak yapım setiyle 6 yaş ve üzeri Disney Karmakarışık hayranlarını yeni maceralar bekliyor. Kutunun içinde gizli laboratuvarı, mutfağı/resim odası, yatak odası, hana inen bir halatı ve ekstra boya malzemelerinin olduğu bir çekmecesi olan 4 katlı bir kule var. Snuggly Duckling Hanı açıldığında hareket edebilen bir masa, sandalyeler ve inşa edilebilen bir oyuncak piyano ortaya çıkar. Yapım setinde Rapunzel, Flynn Rider ve Gothel Ana LEGO ǀ Disney mini bebek figürleri, Pascal LEGO ǀ Disney hayvan figürü, Rapunzel’in kızartma tavası ve oyunları hemen başlatacak çok sayıda başka hikaye başlatıcı parça bulunur. Bu yapım seti, 6 yaş ve üzeri için eğlenceli bir hediyedir ve hayali hikaye anlatımı yoluyla çocukların öz güvenini geliştirir. Gezmeye giderken kolayca taşınabilen bu inşa edilebilen oyuncağı herkes konuşacak. Çocuklar, ayrıca LEGO Builder uygulamasıyla kolay ve sezgisel bir yapım deneyimi yaşar. Modelleri 3 boyutlu yakınlaştırıp döndürebilir, setleri kaydedebilir ve ilerlemelerini takip edebilirler.;

6 yaş ve üzeri çocuklar için inşa edilebilen Rapunzel oyuncağı – Rapunzel’in Kulesi ve The Snuggly Duckling yapım setiyle kız ve erkek çocuklara ilham verin, çocuklar kendi masallarını hayal edip oynasın;
Karmakarışık kulesi – Disney Karmakarışık yapım oyuncağında kule ve han binaları, Flynn Rider, Gothel Ana ve Rapunzel LEGO® ǀ Disney mini bebek figürleri ile Pascal LEGO ǀ Disney hayvan figürü bulunur;
Kayma halatlı yapım seti – 4 katlı kule ile yaratıcı hayali oyun olasılıkları sunan dış merdivenli ve kaydıraklı Snuggly Duckling Hanı arasında Rapunzel’i halattan kaydırın;
LEGO® yapım seti – Rapunzel’in kızartma tavası, Snuggly Duckling’den inşa edilebilen oyuncak piyano gibi simgeleşmiş eşyalar ve daha fazla hikaye başlatıcıyla Disney hayranlarını, yepyeni maceralar oluşturmaya teşvik edin;
6 yaş ve üzeri çocuklar için hediyeler – Rapunzel’i ve hayali oyunları tetikleyen beklenmedik maceraları seven kız ve erkek çocuklar için eğlenceli bir Disney Karmakarışık hediyesidir;
Sezgisel talimatlar – LEGO® Builder uygulaması, modelleri 3 boyutlu olarak yakınlaştırmanıza ve döndürmenize, setleri kaydetmenize ve ilerlemenizi takip etmenize olanak tanıyan araçlarla sezgisel bir yapım macerasında çocuğunuza yol gösterir;
Yaşam becerileri kazandırın – 3LEGO® ǀ Disney mini bebek figürü, bir LEGO ǀ Disney hayvan figürü ve 2 binayla bu yapım seti, yaratıcı oyunları teşvik eder ve eğlendirirken yaşam becerilerini geliştirir;
İnşa edilebilen LEGO® eğlencesi – 623 parçalı yapım setindeki oyuncak kulenin yüksekliği 39 cm, genişliği 12 cm, derinliği 9 cm’dir;
